import React from 'react';
import { View, Image, StyleSheet } from 'react-native';

const TriangleImages = () => {
  return (
    <View style={styles.container}>
      <View style={styles.triangleContainer}>
        <Image
          style={styles.image}
          source={require('../assets/feuille.png')}
          onPress={() => console.log('image 1 pressée')}
        />
        <Image
          style={styles.image}
          source={require('../assets/feuille.png')}
          onPress={() => console.log('image 2 pressée')}
        />
      </View>
      <Image
        style={styles.image}
        source={require('../assets/feuille.png')}
        onPress={() => console.log('image 3 pressée')}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  triangleContainer: {
    width: '80%',
    height: '80%',
    backgroundColor: 'transparent',
    borderStyle: 'solid',
    borderRightWidth: 100,
    borderTopWidth: 100,
    borderRightColor: 'transparent',
    borderTopColor: '#00FF00',
  },
  image: {
    width: '10%',
    height: '10%',
    position: 'absolute',
  },
});

export default TriangleImages;
